const Footer = () => {
  return (
    <>
    <div className='container'>

      <footer className='bg-light text-center'>
          <p>	&copy; 2022 SandipGunjal. All Rights Reserved | Term and Condition . </p>
      </footer>
    </div>
    </>
  );
}

export default Footer;
